import React, { Component } from 'react';
import {Image, Row} from 'react-bootstrap'
import Logo from '../Images/20190402_122358.jpg'

class PageLogo extends Component {
  render() {
    return (
      <Row className="page-logo justify-content-center">
        <Row className="page-logo2 shadow-lg  justify-content-center  align-self-center"  >
                  <Image className="logo-image align-self-center" src={Logo} height="250" width="250" roundedCircle />
        </Row>
      </Row>

    );
  }
}

export default PageLogo;
